            $scope.item.clean = $scope.item.organization.replace(/[\s:,!?]/g, "-").replace(/--/g, "-").replace(/-$/, "").toLowerCase();
            $scope.item.organization && ($scope.url = "http://www.nationalrxcard.com/nrx/" + $scope.item.clean);
